descricao:
Existia 2 registros em DividaParte pra mesma pessoa, um estava quitado e outro nao.

SOLUCAO: remover o registro sem pagamento.

‌

select * from tb\_divida\_parte where id_divida = 45286;

select * from tb\_divida\_valor where id\_divida\_parte = 55832;

**Criado backup com os dados excluidos:**

tb\_divida\_valor\_bck\_trello\_916 e tb\_divida\_parte\_bck\_trello\_916

**Query:**

delete from tb\_divida\_valor where id\_divida\_parte = 55832 ;
delete from tb\_divida\_parte where id\_divida = 45286 and id\_divida_parte = 55832;
